import React from 'react'
import './css/Head_footer.css'

const Head_footer = () => {
  return (
    <div>
        <div class="footer_bg">
            <div class="footer_bg_one"></div>
            <div class="footer_bg_two"></div>
        </div>
    </div>
  )
}

export default Head_footer
